import React from 'react';
import Navbar from './Navbar';

export default function App() {
  return (
    <div>
      <Navbar />
      <main className="mt-20"> {/* Adjust margin-top as needed */}
        <section id="customGPT" className="pt-16">
          <h2>CustomGPT Section</h2>
          <p>This is the CustomGPT section that you will scroll to when clicking the link.</p>
          {/* Add more content here */}
        </section>
        <section id="quizPrep" className="pt-16">
          <h2>Quiz Prep Section</h2>
          <p>This is the Quiz Prep section that you will scroll to when clicking the link.</p>
          {/* Add more content here */}
        </section>
      </main>
    </div>
  );
}
